const Discord = require("discord.js");
const fs = require('fs');

var rectarray = globalVars('reactionRoleInf');

var reactionArray = [];
var emojiArray = [];
var roleArray = [];
var embedSettings = [];

const _this = this;

var errorCatch = 5;
var emojiTimerRe = 0;

var localEmoji;
var localEmojiG;
var interval;
var mainMessage;


let embedTemplate = new Discord.RichEmbed({
    color: 0x00FF00,
    author: {
        name: client.user.username,
        icon_url: client.user.avatarURL
    },
    title: "Kreator Wiadomości",
    description: `Witam w kreatorze wiadomości z reakcjami, przeprowadze ciebie przez drogę stworzenia takiej wiadomości.\n\nNapisz teraz **tytuł** wiadomości do twojej wiadomości z reakcjami!`,
    timestamp: new Date(),
})

// Settings
let grabAllEmoji = false; // Default: false || Set true if you want the bot to use global emojis from all the servers its in. (May cause slowdowns in larger servers)
let roleLimit = 10; // Default: 10 || Sets the maximum number of roles attached to emojis.
let debug = false; // Default: false || Prints any errors that may have occured; will also print for await messages that ran out of time
//

if (grabAllEmoji) {
    localEmoji = (client || this.getDBM().Bot.bot).emojis.array();
    localEmojiG = "Upewnij się czy napisana przez ciebie rola istnieje na tym serwerze!";
} else {
    localEmoji = msg.guild.emojis.array();
    localEmojiG = "Upewnij się czy napisana przez ciebie emotka jest na tym serwerze!";
}

if (msg.member.hasPermission('MANAGE_ROLES')) {
    msg.channel.send(embedTemplate)
        .then(async (message) => {
            mainMessage = message;
            askQuestion(`Witam w kreatorze wiadomości z reakcjami, przeprowadze ciebie przez drogę stworzenia takiej wiadomości.\n\nNapisz teraz **tytuł** wiadomości do twojej wiadomości z reakcjami!`).then((response) => {
                embedSettings[0] = response.content;
                askQuestion(`Twój tytuł wiadomości powinien być **${response.content}**\n\nJeżeli jesteś pewien, że chcesz ten tytuł, napisz teraz **opis** twojej wiadomości.\nJeżeli chcesz anulować, odpowiedz "**anuluj**"`).then((response) => {
                    embedSettings[1] = response.content;
                    if (response.content.toLowerCase() != "anuluj") {
                        askQuestion(`Twój tytuł wiadomości powinien być **${embedSettings[0]}** i twój opis:\n\n${embedSettings[1]}\n\nJeżeli jesteś pewien, że chcesz ten tytuł, odpowiedz "**potwierdz**".\nJeżeli chcesz anulować, odpowiedz "**anuluj**".`).then((response) => {
                            if (response.content.toLowerCase() == "potwierdz") {
                                reAsk(message, " ");
                            } else {
                                errorMessage('Kreator anulowany przez użytkownika (nie odpowiedział "potwierdz").\nProszę napisać ponownie komendę, aby przejść przez kreator ponownie!', "Użytkownik nie odpowiedział 'potwierdz' na opis + tytuł wiadomości");
                            }
                        })
                    } else {
                        errorMessage("Kreator anulowany na prośbę użytkownika.\nProszę napisać ponownie komendę aby przejść przez kreator ponownie!", "użytkownik odpowiedział 'anuluj', co zaskutkowało anulowaniem kreatora");
                    }
                })
            })
        })
} else {
    errorMessage("Nie masz uprawnień `ZARZĄDZANIA ROLAMI` która jest wymagana do wykonania tej komendy!", "użytkownik nie ma uprawnień do wykonania tej komendy.");
}

function reAsk(message, extra) {
    if (extra == null) {
        extra = "";
    }
    if (reactionArray.length != roleLimit) {
        var finalText = "";
        reactionArray.forEach(subarray => {
            finalText = finalText + `${subarray[0]} => ${subarray[2]}\n`
        })
        askQuestion(`Proszę teraz odpowiedz na wiadomość **Emotką i rolą** (Max ${roleLimit})\n ${finalText}\n\nJeżeli zdecydujesz sie dodać inną emotkę do roli, wstaw rolę wraz z emotką.\nNp. @Przykładowa_rola 😃\nJeżeli nie, odpowiedz "**potwierdz**".\nJeżeli zdecydujesz się na anulowanie kreatora, odpowiedz "anuluj"\n\n${extra}`).then(async (response) => {
            if (response.content.toLowerCase() == "potwierdz") {
                if (reactionArray.length > 0) {
                    done(message);
                } else {
                    errorCheck(message, `**Dodaj przynajmiej 1 emotkę na 1 rolę!\nPróbuje pozostać - ${errorCatch}**`, "Kreator został anulowany, użyłeś 2 razy tej samej emotki do 2 róznych ról!\nProszę napisać ponownie komendę aby przejść przez kreator ponownie!");
                }
            } else if (response.content.toLowerCase() == "cancel") {
                errorMessage("Kreator został anulowany.\nProszę napisać ponownie komendę aby przejść przez kreator ponownie!", "użytkownik odpowiedział anuluj, co spowodowało anulowaniem kreatora", message);
            } else {
                var regString = response.content;
                var execReg = /[^\x00-\x7F]/g.exec(regString) || /\<:(.*?)\>/g.exec(regString) || /\<a:(.*?)\>/g.exec(regString);
                var msgSplitArr = null;

                if (execReg != null) {
                    msgSplitArr = [regString.substring(0, execReg["index"]), regString.substring(execReg["index"])];
                }

                if (msgSplitArr != null && msgSplitArr.length > 1 && msgSplitArr[0] != null && msgSplitArr[1] != null) {
                    const tstValidRole = await msg.guild.roles.find(role => role.name === msgSplitArr[0].replace(/\s+$/, ''));

                    if (response.mentions.roles.first() || tstValidRole != null) {
                        var unicodeStored = msgSplitArr[1];
                        if (response.mentions.roles.first() != null) {
                            roleMentioned = response.mentions.roles.first();
                        } else {
                            roleMentioned = tstValidRole;
                        }
                        if (!roleArray.includes(roleMentioned.id) && !emojiArray.includes(unicodeStored)) {
                            if (unicodeStored.includes("<:") || unicodeStored.includes("<a:")) {
                                var emoji;

                                unicodeStored = unicodeStored.replace(/\D/g, '');
                                emoji = localEmoji.filter(emojiT => emojiT.id == unicodeStored);
                                if (emoji.length > 0) {
                                    unicodeStored = emoji[0];
                                    delete unicodeStored['guild']
                                    reactionArray.push([unicodeStored, roleMentioned.id, roleMentioned.name]);
                                    emojiArray.push(unicodeStored);
                                    roleArray.push(roleMentioned.id);
                                    reAsk(message);
                                } else {
                                    errorCheck(message, `**Podaj poprawną niestandardową emotkę!\n${localEmojiG}\nTries left - ${errorCatch}**`, `Kreator został anuluj, wprowadziłeś złą niestandardową emotkę!\n${localEmojiG}\nProszę napisać ponownie komendę aby przejść przez kreator ponownie!`)
                                }
                            } else {
                                reactionArray.push([unicodeStored, roleMentioned.id, roleMentioned.name]);
                                emojiArray.push(unicodeStored);
                                roleArray.push(roleMentioned.id);
                                reAsk(message);
                            }
                        } else {
                            errorCheck(message, `**Nie używaj tej samej emotki/roli dwa razy!\nTries left - ${errorCatch}**`, "Kreator został anulowany, użyłeś tej samej roli dwa razy!\nProszę napisać ponownie komendę aby przejść przez kreator ponownie!");
                        }
                    } else {
                        errorCheck(message, `**Oznaczyłeś niepoprawną rolę!\nTries left - ${errorCatch}**`, "Kreator został anulowany, oznaczyłeś niepoprawną rolę!\nProszę napisać ponownie komendę aby przejść przez kreator ponownie!");
                    }
                } else {
                    errorCheck(message, `**Proszę oznacz poprawną rolę/emotkę\nTries left - ${errorCatch}**`, "Kreator został anulowany, nie wprowadziłeś emotki/roli!\nProszę napisać ponownie komendę aby przejść przez kreator ponownie!");
                }
            }
        });
    } else {
        done(message);
    }
}


function done(message) {
    var finalText = "";
    reactionArray.forEach(subarray => {
        finalText = finalText + `${subarray[0]} => ${subarray[2]}\n`
    })

    askQuestion(`Ostateczna konfiguracja wiadomość\n\nPoniżej znajduje się lista reakcji na ich role\n${finalText}\n\nJeżeli twoja wiadomość jest już gowtowa, oznacz kanał na którym chcesz aby dana wiadomość została przesłana.\nJeżeli zdecydujesz się, że chcesz anulować daną wiadomość odpowiedz "**anuluj**".`).then ((response) => {
        if (response.mentions.channels.first()) {
            var menchannel = response.mentions.channels.first()
            message.delete();
            menchannel.send({
                    embed: {
                        color: 0xffff00,
                        title: embedSettings[0],
                        description: `${embedSettings[1]}\n\n${finalText}`,
                        timestamp: new Date()
                    }
                })
                .then(embedmessage => {
                    interval = setInterval(function() {
                        emojiTimerInt(embedmessage, reactionArray);
                    }, 500)
                    rectarray[embedmessage.id] = reactionArray
                    _this.storeValue(rectarray, 3, "reactionRoleInf", cache);
                    fs.writeFile("./data/reactionRoleData.json", JSON.stringify(rectarray), function(err) {
                        if (err) {
                            return console.log(err);
                        }
                    });
                });
        } else {
            errorMessage("Nie oznaczyłeś prawidłowego kanału!\nProszę napisać ponownie komendę aby przejść przez kreator ponownie!", "Użytkownik nie oznaczył prawidłowego kanału, co zaskutkowało anulowaniem kreatora.", message);
        }
    });
}

function emojiTimerInt(message, subarray) {
    message.react(subarray[emojiTimerRe][0])
    emojiTimerRe += 1;

    if (emojiTimerRe == subarray.length) {
        clearInterval(interval);
    }
}

function errorMessage(error, errorCause = "none") {

    if (debug) {
        console.log(errorCause);
    }

    if (mainMessage != null) {
        mainMessage.delete();
    }

    let errorTemplate = new Discord.RichEmbed({
        color: 0xFF0000,
        author: {
            name: client.user.username,
            icon_url: client.user.avatarURL
        },
        title: "kreator wiadomości",
        description: błąd,
        timestamp: new Date(),
    })

    msg.channel.send(errorTemplate);
}

function errorCheck(mainMessage, erMsgCatch, erMsgFail) {
    if (errorCatch > 0) {
        errorCatch -= 1;
        reAsk(mainMessage, erMsgCatch)
    } else {
        errorMessage(erMsgFail, "Użytkownik zużył wszystkie próby, kreator zostanie anulowany.", mainMessage);
    }
}


function askQuestion(question) {
    return new Promise(function(resolve, reject) {
        embedTemplate["description"] = question;
        mainMessage.edit(embedTemplate);
        msg.channel.awaitMessages(response => response.author.id == msg.author.id, {
                max: 1,
                time: 60000,
                errors: ['time'],
            })
            .then(function(collected) {
                msg.author.lastMessage.delete();
                resolve(collected.first());
            }).catch((error) => {
                errorMessage('Nie zdążyłeś napisać na czas!\nProszę napisać ponownie komendę aby przejść przez kreator ponownie!', error);
            });
    })

}
